import MediaCard from './MediaCard'
import { Box, Grid, Container, Typography } from '@mui/material'

const Projects = () => {
    return (
        <Box component="div" sx={{
            margin:3
        }}>
            <Typography variant="h4" color="inherit" component="div" sx={{

                margin: 2
            }}>
                Projects
            </Typography>
            <Grid container justify="center" sx={{
                marginTop: 4
            }}>
                <Grid item xs={3} sm={3} mr={9} ml={3}>
                    <MediaCard></MediaCard>
                </Grid>

                <Grid item xs={3} sm={3} mr={9}>
                    <MediaCard></MediaCard>
                </Grid>
                <Grid item xs={3} sm={3} mr={9}>
                    <MediaCard></MediaCard>
                </Grid>



            </Grid>




        </Box>
    )
}

export default Projects
